import shortid from "../../node_modules/shortid";

function TodolistItem(item,swapBtn) {
  return (
    <li key={shortid.generate()}>
      {item.content ? item.content : null}{" "}
      <button type="button" name="up" onClick={()=>{swapBtn('up')}}>
        UP
      </button>
      <button type="button" name="down">
        DOWN
      </button>
    </li>
  );
}
export default TodolistItem;
